def insert_sort(lst):
    count = 0
    for i in range(0, len(lst)):
        key = lst[i]
        j = i - 1
        while j >= 0 and key < lst[j]:
            lst[j + 1] = lst[j]
            j -= 1
            count += 1
        lst[j + 1] = key

    return count


